//React
import React, { Component } from "react";

//React Router
// import { BrowserRouter as Router, Link } from "react-router-dom";

//Pages
// import Home from "./home";

//Bootstrap Components
import { Col, Container, Row } from "react-bootstrap";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

//Components

class CardWidget extends Component {
  render() {
    return (
      <Container>
        <Row className="justify-content-center">
            <Col sm={12} className="card cardWidget">
              <div>
                <i class="lni lni-32 lni-capsule"></i>
                <h2 className="static400">Verify Eligibility & Benefits</h2>
                <hr />
                <Form className="textAlignLeft">
                  <Form.Group controlId="formBasicEmail">
                    <Form.Label>Email address</Form.Label>
                    <Form.Control type="email" placeholder="Enter email" />
                    <Form.Text className="text-muted">
                      We'll never share your email with anyone else.
                    </Form.Text>
                  </Form.Group>
                  <Form.Group controlId="formBasicPassword">
                    <Form.Label>Password</Form.Label>
                    <Form.Control type="password" placeholder="Password" />
                  </Form.Group>
                  <Form.Group controlId="formBasicCheckbox">
                    <Form.Check type="checkbox" label="Check me out" />
                  </Form.Group>
                  <Button variant="primary" type="submit">
                    Submit
                  </Button>
                </Form>
              </div>
            </Col>
            <Col sm={12} className="card cardWidget">
              <div className="copyBlock">
                <h2 className="static400">Hello, Manny</h2>
                <p>
                  Lorem, ipsum dolor sit amet consectetur adipisicing elit.
                  Quasi animi fugit voluptas ipsum molestias, cum saepe autem,
                  error illo magni ut rem voluptate corporis nobis fugiat est
                  atque culpa id.
                </p>
              </div>
            </Col>
        </Row>
      </Container>
    );
  }
}

export default CardWidget;
